import React, { useEffect } from 'react';
import fetch from 'node-fetch'



function HomePage() {
  let data = []

  useEffect(() => {
    fetch('http://localhost:3001/users/all')
    .then(res => {
      return res.json()
    })
    .then(result => {
      result.forEach(item => data.push(item))
      return data
    })
    .then(
      console.log(data)
    )
  });

  return (
  <div>
    Welcome to Next.js!
    <div>
      {data.forEach}
    </div>
  </div>
  )
}

export default HomePage
